(79800, 313498, 7224, 5, 'A Bad Dream', '潛入最深的海底 發現最美的聲音基音 深海之音遺傳希望與恐懼 全英音樂獎的好基音全球知名樂評及名人爭相推薦 2006樂壇鎖定目光焦點活在「希望與恐懼」當中，一切都超乎預期。不能說基音樂團沒有野心，三個年輕人的確也想多賣個幾張唱片養活自己，但是當主唱Tom、鍵盤手Tim、鼓手Richard，發現首張專輯『希望與恐懼』暢銷五百萬張，家人紛紛把白金唱片掛在牆上，「快把他們拿下來！」是他們一致的回答，因為對基音而言，演唱比作秀重要的太多。2003年的基音還擠在英國Kings Cross的小CLUB演唱、2005年出現在美國麥迪遜廣場，甚至前進數十萬人的Live 8，台上的他們散發著魅力，台下的他們卻不斷激盪著新的念頭：要討好樂評嗎？討好歌迷？還是乾脆模仿第一張？感謝老天！基音最後只有一個念頭：聽聽自己心裡的聲音，自己感動，歌迷才能感受。2006【深海之音】，在好的遺傳基因（鋼琴、鼓聲、歌聲）下，Keane基音樂團一鼓作氣，把自己拉拔成音樂巨人。說真的，基音三個人比賽不擅言詞很難分出冠亞軍，但是透過音樂，他們卻競爭激烈，每個人都可以各自表述一個全新的搖滾神話世界。基音用一台老式的電子琴以及類比式的電子合成器，完成了一張深具情緒強度與濃度的音樂作品【深海之音】。專輯中有考驗著團員情誼的"Atlantic"、"Broken Toy"，表達這個世代充滿疑惑的無力感"Is It Any Wonder?"，以及從愛爾蘭詩人W.B.葉慈的詩作中激發創作靈感的深思作品"A Bad Dream"，而在"Put It Behind You"充滿基音風味歌曲之後，再給你一段隱藏配樂，令人驚喜，巧思無限。每個人心中，都有不為人知的深海之音，有點邪惡、充滿故事性。基音的全新專輯，專注點不只在音樂，視覺也是重點。為此，【深海之音】專輯封面以及內頁，邀請芬蘭新銳女插畫家Sanna Annukka，彩繪出１１組連續圖案，企圖讓每一個人在視覺與聽覺上能夠找到一個平衡；此外也特地邀請到「猜火車」的作家Irvine Welsh為專輯的序曲"Atlantic"拍攝MV。另外，很多人在問，為什麼專輯名稱叫做【深海之音】呢？原因是基音很悶，說不出口還悶在心底、藏在比海底還深的地方，為此差一點解散，但是回到音樂，三個人把潛藏的聲音一次爆發，【深海之音】比以前作品更具張力，樂團也因為相同的基因、濃厚的關係，再度緊密結合…。好險，不然叫全球五百萬人去哪裡聽到會起雞皮疙瘩的好聲音呢？', '2007-12-03 00:00:00', 2007, 19, 0, 7, '', '', 240, '', '', '', '', '', '', 0, 1, 0, '2014-09-17 16:37:09', '2015-03-12 14:09:21', '0000-00-00 00:00:00'),
